import React from 'react'
import {withCharacter} from './MyProvider'

function Character(props) {
    let {name, alias, house} = props
    return(
        <div>
            <div>
                Character
                <h2>{name}</h2>
                <h4>{alias}</h4>
                <p>{house}</p>
            </div>
        </div>
    )
}

export default withCharacter(Character)
